import React from 'react';
import ReactDOM from 'react-dom';
import "./BaseInformation.css"
import high_battery from '../images/high_battery.png';
import medium_battery from '../images/medium_battery.png';
import low_battery from '../images/low_battery.png';


function get_image(battery_percentage){
  if(battery_percentage>=process.env.REACT_APP_HIGH_BATTERY_LIMIT){
    return high_battery
  }else if(battery_percentage<=process.env.REACT_APP_HIGH_BATTERY_LIMIT && battery_percentage>=process.env.REACT_APP_MEDIUM_BATTERY_LIMIT){
    return medium_battery
  } else{
    return low_battery
  }
}


export default function BaseInformation () {
  let battery_percentage=40
    return (  
        <div className="rectangle" >
        <img
          src={get_image(battery_percentage)}
          width="30"
          height="30"
        />
        {battery_percentage} %
        </div>
    );
    
}
